import{_ as r,c as e,o as b,a as o}from"./app.af7f7d8f.js";const f='{"title":"1985/11/05 - \u6D5C\u677E\u5E02\u6C11\u4F1A\u9928","description":"","frontmatter":{},"headers":[{"level":3,"title":"15\u306E\u591C","slug":"_15\u306E\u591C"},{"level":3,"title":"Freeze Moon","slug":"freeze-moon"}],"relativePath":"Live/19851105.md","lastUpdated":1639876241654}',a={},t=o('<h1 id="_1985-11-05-\u6D5C\u677E\u5E02\u6C11\u4F1A\u9928" tabindex="-1">1985/11/05 - \u6D5C\u677E\u5E02\u6C11\u4F1A\u9928 <a class="header-anchor" href="#_1985-11-05-\u6D5C\u677E\u5E02\u6C11\u4F1A\u9928" aria-hidden="true">#</a></h1><hr><h3 id="_15\u306E\u591C" tabindex="-1">15\u306E\u591C <a class="header-anchor" href="#_15\u306E\u591C" aria-hidden="true">#</a></h3><blockquote><p>\u6700\u8FD1\u3001\u4FFA\u306F\u3053\u3093\u306A\u4E8B\u3092\u8003\u3048\u3066\u3044\u308B\u3002<br> \u3082\u3046\u5927\u5206\u524D\u306E\u4E8B\u306B\u306A\u308B\u3051\u308C\u3069\u3001\u3053\u306E\u30C4\u30A2\u30FC\u304C\u59CB\u307E\u308B\u5C11\u3057\u524D\u306B<br> \u6BCE\u6669\u4E00\u7DD2\u306B\u622F\u308C\u3066\u3044\u305F\u4EF2\u9593\u306E\u3046\u3061\u306E\u4E00\u4EBA\u304C\u30C9\u30E9\u30C3\u30B0\u3067\u6B7B\u3093\u3067\u3057\u307E\u3063\u305F\u3002<br> \u9053\u3092\u6B69\u3044\u3066\u308B\u9014\u4E2D\u3067\u9F3B\u304B\u3089\u8133\u307F\u305D\u3092\u5782\u308C\u6D41\u3057\u3066\u7A81\u7136\u6B7B\u3093\u3060\u3002<br> \u305D\u306E\u9803\u304B\u3089\u3001\u306A\u3093\u3060\u304B\u4FFA\u306F\u3001\u4EF2\u9593\u3063\u3066\u3044\u3046\u3082\u306E\u3092\u610F\u8B58\u3057\u59CB\u3081\u308B\u3088\u3046\u306B\u306A\u3063\u305F\u3002<br> \u305D\u3044\u3064\u306F2\uFF7A\u4E0B\u306E\u5F8C\u8F29\u3067\u3001\u3044\u3064\u3082\u4FFA\u306E\u9854\u3092\u898B\u3066\u306F<br> \u300C\u5C3E\u5D0E\u3055\u30FC\u3093\u3001\u4ECA\u5EA6\u30B3\u30F3\u30B5\u30FC\u30C8\u884C\u304D\u307E\u3059\u304B\u3089\u300D\u306A\u3093\u3066\u3001\u6700\u5F8C\u306E\u65E5\u3082\u305D\u3046\u8A00\u3063\u3066\uFF65\uFF65\uFF65<br> \u6BCE\u6669\u306E\u3088\u3046\u306B\u4E00\u7DD2\u306B\u5C45\u308B\u3063\u3066\u3044\u3046\u306E\u306B\u3001\u305D\u3044\u3064\u306E\u53EB\u3073\u3092\u8AB0\u3082\u805E\u3044\u3066\u3084\u308B\u4E8B\u304C\u51FA\u6765\u306A\u304B\u3063\u305F\u3002<br> \u4EF2\u9593\u3063\u3066\u3044\u3046\u3082\u306E\u3092\u610F\u8B58\u3057\u59CB\u3081\u3066\u304B\u3089\u3001\u30A4\u30DE\u307E\u3067\u306E\u81EA\u5206\u3063\u3066\u3044\u3046\u306E\u304C<br> \u306A\u3093\u3060\u304B\u3068\u3063\u3066\u3082\u3001\u3084\u3089\u3057\u3044\u4EBA\u9593\u306B\u601D\u3048\u3066\u306A\u3089\u306A\u304B\u3063\u305F\u3002<br> \u81EA\u5206\u306B\u89E3\u308B\u3082\u306E\u3060\u3051\u3092\u53D6\u308A\u5165\u308C\u3001\u89E3\u3089\u306A\u3044\u3082\u306E\u306F\u5426\u5B9A\u3057\u3002<br> \u305D\u308C\u304B\u3089\u4FFA\u9054\u306F\u3001\u305D\u3044\u3064\u3092\u5F14\u3046\u3088\u3046\u306B\u6BCE\u6669\u306E\u3088\u3046\u306B\u55A7\u5629\u306B\u660E\u3051\u66AE\u308C\u305F\u3002<br> \u8AB0\u304C\u5F37\u3044\u3068\u3044\u3046\u308F\u3051\u3067\u3082\u306A\u3044\u3051\u308C\u3069\u3001\u5FC5\u6B7B\u3067\u81EA\u5206\u306E\u5F31\u3055\u3068\u6226\u3063\u3066\u3044\u308B\u3088\u3046\u306B\u601D\u3048\u3066\u306A\u3089\u306A\u304B\u3063\u305F\u3002<br> \u4EBA\u3092\u611B\u3059\u308B\u4E8B\u304C\u3001\u305D\u3093\u306A\u751F\u534A\u53EF\u306A\u4E8B\u3058\u3083\u51FA\u6765\u306A\u3044\u3068\uFF65\uFF65\uFF65</p></blockquote><p>\u6700\u8FD1\u6211\u5728\u60F3\u8457\u9019\u7A2E\u4E8B\u3002<br> \u96D6\u7136\u5DF2\u904E\u4E86\u5F88\u4E45\uFF0C\u4F46\u5728\u9019Tour\u958B\u59CB\u524D\u4E0D\u4E45\uFF0C<br> \u6211\u5176\u4E2D\u4E00\u500B\u6BCF\u665A\u4E00\u8D77\u904A\u73A9\u7684\u670B\u53CB\u56E0\u70BA\u6BD2\u54C1\u800C\u6B7B\u4E86\u3002<br> \u5728\u8D70\u8DEF\u9014\u4E2D\u8166\u9AD3\u5F9E\u9F3B\u6D41\u51FA\u4F86\u800C\u7A81\u7136\u6B7B\u4E86\u3002<br> \u90A3\u6642\u958B\u59CB\uFF0C\u7E3D\u89BA\u5F97\u6211\u958B\u59CB\u610F\u8B58\u5230\u540C\u4F34\u9019\u7A2E\u6771\u897F\u3002<br> \u90A3\u50A2\u4F19\u662F\u5C0F\u6211\u5169\u6B72\u7684\u5F8C\u8F29\uFF0C\u7E3D\u662F\u671B\u8457\u6211\u8AAA\uFE55<br> \u300C\u5C3E\u5D0E\u524D\u8F29\uFF0C\u9019\u6B21\u6211\u6703\u53BB\u4F60\u7684\u6F14\u5531\u6703\u3002\u300D\u5728\u6700\u5F8C\u4E00\u5929\uFF0C\u4ED6\u4E5F\u662F\u9019\u6A23\u8AAA\u2026\u2026<br> \u96D6\u7136\u6BCF\u665A\u5728\u4E00\u8D77\uFF0C\u53EF\u662F\u90A3\u50A2\u4F19\u5167\u5FC3\u7684\u53EB\u558A\uFF0C\u6211\u5011\u6C92\u6709\u4E00\u500B\u807D\u5F97\u5230\u3002<br> \u7576\u6211\u958B\u59CB\u610F\u8B58\u540C\u4F34\u9019\u7A2E\u6771\u897F\u6642\uFF0C\u6211\u4E0D\u7981\u89BA\u5F97\uFF0C\u4E00\u76F4\u4EE5\u4F86\u7684\u81EA\u5DF1\uFF0C\u4E0D\u7BA1\u600E\u8AAA\uFF0C\u90FD\u662F\u4E00\u500B\u8A0E\u53AD\u7684\u4EBA\u3002<br> \u53EA\u63A5\u53D7\u81EA\u5DF1\u4E86\u89E3\u7684\u6771\u897F\uFF0C\u5426\u5B9A\u81EA\u5DF1\u4E0D\u4E86\u89E3\u7684\u6771\u897F\u3002<br> \u4E4B\u5F8C\uFF0C\u6211\u5011\u5C31\u50CF\u6191\u5F14\u4ED6\u4E00\u822C\uFF0C\u6BCF\u665A\u6253\u67B6\u5230\u5929\u4EAE\u3002<br> \u4E26\u4E0D\u662F\u8AAA\u8AB0\u5F37\uFF0C\u4F46\u6211\u4E0D\u7981\u89BA\u5F97\u6211\u5011\u5728\u62DA\u547D\u8207\u81EA\u5DF1\u7684\u61E6\u5F31\u6230\u9B25\u3002<br> \u6211\u60F3\uFF0C\u611B\u4EBA\u9019\u7A2E\u4E8B\uFF0C\u4E26\u4E0D\u662F\u90A3\u6A23\u82DF\u4E14\u5C31\u80FD\u505A\u5230\u7684\u2026\u2026</p><br><h3 id="freeze-moon" tabindex="-1">Freeze Moon <a class="header-anchor" href="#freeze-moon" aria-hidden="true">#</a></h3><blockquote><p>\u4ECA\u591C\u3053\u3046\u3057\u3066\u307F\u3093\u306A\u3068\u4E00\u7DD2\u306B\u591C\u3092\u308F\u304B\u3061\u3042\u3044\uFF08\u3048\uFF09\u305F\u3053\u3068<br> \u672C\u5F53\u306B\u5B09\u3057\u304F\u601D\u3044\u307E\u3059<br> \u3069\u3046\u3082\u3042\u308A\u304C\u3068\u3046<br> \u4FFA\u306F\u3001\u3053\u306E\u30C4\u30A2\u30FC\u306B\u95A2\u308F\u308B\u5168\u3066\u306E\u30B9\u30BF\u30C3\u30D5\u3084PA\u3084\u7167\u660E\u3084<br> \u30ED\u30FC\u30C7\u30A3\u30FC\u3084\u3001\u305D\u3057\u3066\u30E1\u30F3\u30D0\u30FC\u3084<br> \u5168\u3066\u306B\u8A87\u308A\u3092\u6301\u3063\u3066\u3053\u306E\u30C4\u30A2\u30FC\u3092\u307E\u308F\u3063\u3066<br> \u305D\u3057\u3066\u4ECA\u591C\u3053\u3046\u3057\u3066\u3053\u3053\u306B\u96C6\u307E\u3063\u3066\u304F\u308C\u305F\u307F\u3093\u306A\u3092\u304A\u308C\u306E\u4EF2\u9593\u30AF\u30E9\u30AF\u30B7\u30E7\u30F3\u547C\u3093\u3067\u3044\u3044\u304B\u3044\uFF1F<br> \u307F\u3093\u306A\u304C\u81EA\u7531\u3068\u771F\u5B9F\u3092\u63B4\u3093\u3067\u3044\u304F\u305F\u3081\u306B\u4FFA\u306F\u6B4C\u3044\u7D9A\u3051\u306A\u304F\u3066\u306F\u3001\u3084\u304C\u3066\u3044\u3064\u304B\u3001\u4ECA\u591C\u3053\u3046\u3057\u3066\u96C6\u307E\u3063\u3066\u304F\u308C\u305F\u307F\u3093\u306A\u3059\u3079\u3066\u304C\u7B11\u3063\u3066\u3044\u3089\u308C\u308B\u3088\u3046\u6B4C\u3044\u3001\u305D\u3057\u3066\u305D\u308C\u3092\u4FFA\u306F\u5FC3\u304B\u3089\u7948\u3063\u3066\u3044\u308B\u3002</p></blockquote><p>\u80FD\u8DDF\u5927\u5BB6\u4E00\u8D77\u5206\u4EAB\u4ECA\u591C\uFF0C\u6211\u611F\u5230\u5F88\u958B\u5FC3\u3002<br> \u975E\u5E38\u591A\u8B1D\u4F60\u5011\uFF01<br> \u8DDF\u9019\u6B21Tour\u76F8\u95DC\u7684\u6240\u6709Staff\u3001\u7167\u660E\u3001Roadie\uFF0C\u9084\u6709Member\uFF0C<br> \u5168\u90FD\u5E36\u8457\u81EA\u8C6A\u70BA\u6B64Tour\u52AA\u529B\u3002<br> \u53E6\u5916\uFF0C\u6211\u53EF\u4EE5\u7A31\u547C\u5728\u6B64\u805A\u96C6\u7684\u5927\u5BB6\u70BA\u6211\u7684\u540C\u4F34\uFF2B\uFF2C\uFF21\uFF38\uFF2F\uFF2E\u55CE\uFF1F</p><blockquote><p>\u591C\u306E\u8857\u3067\u98A8\u304C\u5439\u304F\u305F\u3073\u3001\u4FFA\u305F\u3061\u306F\u7159\u8349\u3092\u3075\u304B\u3057\u3001<br> \u6700\u5F8C\u306E\uFF11\u672C\u3092\u5438\u3044\u7D42\u3048\u308B\u3068\u5E30\u308B\u91D1\u306B\u3059\u3089\u8DB3\u308A\u306A\u304F\u306A\u3063\u3061\u307E\u3046\u3001<br> \u306A\u3042\u307F\u3093\u306A\u5922\u306F\u3042\u308B\u304B\u3044\uFF1F<br> \u5922\u3092\u8CA0\u3044\u7D9A\u3051\u3066\u3086\u304F\u3053\u3068\u304C\u3067\u304D\u308B\u304B\u3044\uFF1F<br> \u3046\u307E\u304F\u8A00\u3046\u3053\u3068\u306A\u3093\u3066\u3067\u304D\u3084\u3057\u306A\u3044\u3001<br> \u305F\u3060\u30FB\u30FB\u30FB\u4ECA\u591C\u3053\u3046\u3057\u3066\u5922\u898B\u305F\u307F\u305F\u3044\u306B\u3001\u4FFA\u306F\u751F\u304D\u3066\u3044\u304D\u305F\u3044<br> \u3060\u304B\u3089\u3082\u3063\u3068\u901F\u304F\u3001\u3082\u3063\u3068\u3082\u3063\u3068\u901F\u304F<br> \u4FFA\u305F\u3061\u306F\u8D70\u308A\u7D9A\u3051\u3066\u3086\u304B\u306A\u3051\u308C\u3070\u306A\u3089\u306A\u3044\u3093\u3060<br> \u30D0\u30FC\u30A4\u3000See You Rock Roll</p></blockquote><p>\u5728\u9ED1\u591C\u7684\u8857\u4E0A\uFF0C\u6BCF\u7576\u665A\u98A8\u5439\u904E\uFF0C\u6211\u5011\u4FBF\u5674\u4E00\u53E3\u9999\u7159\uFF0C<br> \u7576\u6211\u5011\u5438\u5B8C\u6700\u5F8C\u4E00\u652F\u4E4B\u5F8C\uFF0C\u5DF2\u9023\u6B78\u5BB6\u7684\u8ECA\u8CBB\u4E5F\u6C92\u6709\u4E86\uFF0C<br> \u6211\u5011\u5230\u5E95\u80FD\u505A\u5F97\u5230\u751A\u9EBC\uFF1F<br> \u5404\u4F4D\uFF0C\u4F60\u5011\u6709\u5922\u60F3\u55CE\uFF1F<br> \u80FD\u5920\u7E7C\u7E8C\u8FFD\u6C42\u5922\u60F3\u55CE\uFF1F<br> \u7D55\u5C0D\u3001\u7D55\u5C0D\u4E0D\u6703\u8F38\u7D66\u81EA\u5DF1\u55CE\uFF1F<br> \u96D6\u7136\u7121\u6CD5\u7528\u8A00\u8A9E\u8868\u9054\u6E05\u695A\uFF0C<br> \u4F46\u662F\uFF0C\u5C31\u50CF\u4ECA\u591C\u6211\u5011\u770B\u5230\u7684\u5922\u822C\uFF0C\u6211\u6E34\u671B\u90A3\u6A23\u53BB\u751F\u5B58\u3002<br> \u56E0\u6B64\uFF0C\u518D\u52A0\u5FEB\u4E00\u9EDE\u5427\uFF0C\u76F4\u81F3\u767C\u51FA\u66F4\u5927\u66F4\u5927\u7684\u5149\u8F1D\uFF01<br> \u6211\u5011\u5FC5\u9808\u7E7C\u7E8C\u4E0D\u65B7\u7684\u5954\u8DD1\u4E0B\u53BB\uFF01<br> BYE\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01\uFF01</p><hr><p>\u8F49\u8F09\u81EA:</p><ul><li><a href="https://matagorou.hatenablog.com/entry/36939658" target="_blank" rel="noopener noreferrer">\u6D5C\u677E\u5E02\u6C11\u4F1A\u9928</a></li><li><a href="http://web.archive.org/web/20110429214124/http://blog.yam.com/forgetnot/category/634985/page=2" target="_blank" rel="noopener noreferrer">1985\u5E7411\u670815\u65E5 \u4EE3\u4EE3\u6728</a></li></ul><p>\u5F8C\u6309\uFF1A1985\u5E74\u4EE3\u4EE3\u6728\u7684\u6642\u5E8F\u4E82\u4E86\uFF0C\u62C6\u51FA\u4F86\u91CD\u65B0\u6574\u7406...</p>',15),n=[t];function l(c,p,_,i,h,d){return b(),e("div",null,n)}var u=r(a,[["render",l]]);export{f as __pageData,u as default};
